import '../css/home.css'

function Home() {
  return (
    <div>
       <nav className='navbar'>
        <ul className="nav-list">
            <img src="" alt="LOGO" />
            <li>Home</li>
            <li>About</li>
            <li>Map</li>
        </ul>
       </nav>
    </div>
  );
}

export default Home;
